                <div key={index} className="content-section">
                  <h3>{section.category}</h3>
                  <div className="items-grid">
                    {section.items.map((item, itemIndex) => (
                      <div key={itemIndex} className="cheat-item">
                        <h4>{item.name}</h4>
                        <p>{item.description}</p>
                      </div>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  )
